import { ImageBackground, StyleSheet, Text, View } from 'react-native';
import AppLoading from 'expo-app-loading'; //expo install expo-app-loading
import {
    Antic_400Regular
} from '@expo-google-fonts/antic';

const page2text = ({height, width}) =>{
    let [fontsLoaded] = useFonts({
        Cabin_400Regular,
    });
    if (!fontsLoaded) {
        return <AppLoading />;

    } else {
    return(
        <View style={{width: width, height: height, justifyContent:'center', alignItems:'center'}}>
          <View style={{width:60, height:60, borderRadius:45, borderColor:'white', borderWidth:3, justifyContent:'center', alignItems:'center'}}>
                    <Text style={{fontSize:40, color:'white', fontFamily:'Cabin_400Regular'}}>!</Text>
                </View>
                <Text style={{fontFamily:'Cabin_400Regular'}}>RICORDATI DI COLLEGARTI</Text>
                <Text>ALLA RETE DEL RISTORANTE</Text>
        </View>
    );
    }
}

export default page2text;
